import { ChangeEvent } from "react";
// import './weather.css';
import { Content } from "./Content";

interface IWeather {
    onChange: (event: ChangeEvent<HTMLInputElement>) => void;
    onClick?: () => void;
    onKeyDown: (event: any) => void;
    value: string;
    data: any;
}

export function Weather({onChange, onKeyDown, value, data}: IWeather) {
    // console.log('ooo: ', data)
    return (
        <div className="weather__wrapper">
            <input className="input" type="search" defaultValue={value} onKeyDown={onKeyDown} onChange={onChange} />
            {/* <button onClick={onClick} /> */}
            {data && <Content data={data.data} />}
        </div>
    )
}
